2. Next, open up a terminal or command prompt and navigate to the directory where you want to start your ExpressJS server.
3. Run the following command to initialize a new NodeJS project and create a package.json file:
```
npm init -y
```
4. Now, install the ExpressJS framework by running the following command:
```javascript
npm install express
```
5. Create an index.js file in your project directory with the following code:
```javascript
const express = require('express');
const app = express();

app.use(express.json());

app.get('/', (req, res) => {
  res.send('Welcome to my ExpressJS server!');
});

const PORT = process.env.PORT || 3000;
app.listen(PORT, () => {
  console.log(`Server is running on port ${PORT}`);
});
```
This code sets up a basic ExpressJS server that listens on port 3000 and responds with a "Welcome to my ExpressJS server!" when you visit the root URL (URL.com, URL/.com).

