To build the "Healthy" microservice, I would recommend using the Node.js framework in JavaScript as well. Here's a rough outline of how to implement the service:

1. Set up a new Node.js project and install the necessary dependencies.
2. Create an endpoint for the service using the `app.post('/check')` method and route it to the appropriate function.
3. Within the function, parse the list of packages from the request body.
4. Iterate through the packages and for each one, fetch the necessary information from NPM and GitHub using the `axios` library.
5. Apply the security health rules to each package, returning the result as desired.
6. Return the results for all packages in the response.

Here's some sample code to get started:
```javascript
const express = require('express');
const axios = require('axios');
const inquirer = require('inquirer');

const app = express();

app.use(express.json());

app.post('/check', async (req, res) => {
  const packages = req.body.packages;

  const results = packages.map(async package => {
    try {
      const { response } = await axios.get(`https://www.npmjs.com/pkg/${package}`);
      const { data: commits } = await axios.get(`https://api.github.com/repos/${response.originalrepo}/commits?ref=master&max_commits=1`);

      const latestCommitDate = commits[commits.length - 1].commit.committedDate;
      const createdDate = new Date(response.created_at);
      const daysSinceCreated = Math.floor((Date.now() - createdDate.getTime()) / (1000 * 3600 * 24));

      if (daysSinceCreated > 30) {
        throw new Error('Package last version is more than 30 days old');
      }

      const npmVersion = response.versions['__latest__'];
      const { data: maintainers } = await axios.get(`https://api.github.com/repos/${response.originalrepo}/contributors`, { params: { per_page: 100 } });
      const numMaintainers = maintainers.data.length;

      if (numMaintainers < 2) {
        throw new Error('Package has less than 2 maintainers');
      }

      const latestGitHubCommitDate = new Date(latestCommitDate).toISOString().split('T')[0];
      const githubCreatedDate = new Date(createdDate).toISOString().split('T')[0];
      const daysSinceCreatedOnGitHub = Math.floor((Date.now() - new Date(githubCreatedDate).getTime()) / (1000 * 3600 * 24));

      if (daysSinceCreatedOnGitHub > 14) {
        throw new Error('Package latest commit on GitHub is more than 14 days old');
      }

      return { isHealthy: true, version: npmVersion };
    } catch (error) {
      console.error(error);
      return { isHealthy: false, reason: error.message };
    }
  });

  const finalResults = await Promise.all(results);
  res.json(finalResults);
});

app.listen(3000, () => {
  console.log('Server listening on port 3000');
});
