Sure! Here is an example of Java code for implementing the Quick Sort algorithm:

This implementation chooses the first element of the array as the pivot element, partitioning the array around the pivot. Elements less than the pivot are kept on the left side of the partition, and elements greater than the pivot are kept on the right side [[1](https://www.programiz.com/java-programming/examples/quick-sort)][[3](https://www.geeksforgeeks.org/quick-sort/)].
```java
public class QuickSort {

    public static void quickSort(int[] arr, int low, int high){
        if(low < high){
            int pivotIndex = partition(arr, low, high);

            quickSort(arr, low, pivotIndex - 1);
            quickSort(arr, pivotIndex + 1, high);
        }
    }

    public static int partition(int[] arr, int low, int high){
        int pivot = arr[low];
        int i = low - 1;

        for(int j = low; j <= high; j++){
            if(arr[j] < pivot){
                i++;
                swap(arr, i, j);
            }
        }
        swap(arr, i+1, high);
        return i+1;
    }

    public static void swap(int[] arr, int i, int j){
        int temp = arr[i];
        arr[i] = arr[j];
        arr[j] = temp;
    }

    public static void quickSortAlgo(int[] arr, int startIndex, int endIndex) {
        quickSort(arr, startIndex, endIndex - 1);
    }

    public static void main(String[] args) {
        int[] arr = {10, 7, 8, 9, 1, 5};

        quickSortAlgo(arr, 0, arr.length - 1);

        System.out.println("Sorted array:");
        for(int i = 0; i < arr.length; i++) {
            System.out.print(arr[i] + " ");
        }
    }
}
```
In this implementation, the `quickSort` method takes an integer array, a starting index, and an ending index as input, and divides the array into two parts: elements less than the pivot element and elements greater than the pivot element. It then recursively calls itself until all subarrays have been sorted.

The `partition` method takes an array, a starting index, and an ending index as input, and chooses the first element of the array as the pivot element. It then rearranges the input array so that all elements less than or equal to the pivot element are on the left side of the partition, and all elements greater than or equal to the pivot element are on the right side.

The `swap` method simply swaps two elements in the input array.

The `quickSortAlgo` method takes an array and two indices, and calls the `quickSort` method with the given array and the two indices.

The `main` method initializes an example array of integers, calls the `quickSortAlgo` method with the array and the starting and ending indices, and then prints out the sorted array.

